import React from 'react';
import { reduxForm, Field } from 'redux-form';

const SignInForm = ({ handleSubmit, reset, pristine, submitting, valid }) => {
    
    return (
        <form onSubmit={handleSubmit(val => console.log(val))}>
        <Field
          name="login"
          type="text"
          component="input"
          placeholder="Login"
          label="Login"
        />
        <Field
          name="password"
          type="text"
          component="input"
          placeholder="Password"
          label="Password"
        />
        <button type="submit" disabled={!valid || pristine || submitting}>
          Submit
        </button>
        <button type="button" onClick={reset}>
          reset
        </button>
      </form>
    );
}

export default compose(
    reduxForm()
)(SignInForm);
